import mainBox from "./main";
import mainSubBox from "./subMain";
import tabs from "./tabs";
import { queryManufacturers } from "@/api/project/iot/IOT/em";
export default {
  name: "projectCenter",
  components: {
    mainBox: mainBox,
    mainSubBox: mainSubBox,
    tabs: tabs
  },
  created: function created() {
    this.$store.dispatch('iotDict/getDicData', ['iot_state_device', 'iot_project_type', 'iot_state']);
    this.getTeam();
  },
  data: function data() {
    return {
      pages: 'main',
      code: undefined,
      row: undefined,
      title: undefined,
      manufacturersList: null
    };
  },
  methods: {
    setPage: function setPage(val) {
      this.pages = val;
    },
    setCode: function setCode(val) {
      this.code = val.projectCode;
      this.title = val.projectName;
    },
    setRow: function setRow(val) {
      this.row = val;
    },
    getTeam: function getTeam() {
      var _this = this;

      queryManufacturers().then(function (res) {
        _this.manufacturersList = res.data.list;
      });
    }
  }
};
